import async from 'async';

export function validateIndex (server, domainName, cb) {
    const client = server.plugins.elasticsearch.getCluster('admin').getClient();

    const config = server.config();
    const index = `${config.get('kibana.index') || '.kibana'}-${domainName}`;
    const buildNum = config.get('pkg.buildNum') || '14588';
    const id = config.get('pkg.version') || '5.2.2';
    console.log(index, id);
    client.get({
        index: index,
        type: "config",
        id: id
    }, (err, exists) => {
        console.dir(err, {depth: 5});

        if (err && err.status !== 404)
            return console.error(err);
        
        if (!exists || exists.status === 404) {
            console.log(`Try create index`);
            createIndex(client, index)
                .then(createConfig(client, index, id, buildNum, domainName)
                    .catch(setupError)
                    .then(cb)
                    .then(createIndexPattern(client, index)
                        .then(cb))
                        .catch(setupError)
                )
                .catch(setupError)
        }
    })
}

function setupError(err) {
    console.log(err)
}

function createIndex(client, index) {
    console.log(`Create index ${index}`);
    return client.indices.create({
        index: index,
        body: {
            settings: {
                number_of_shards: 1
            },
            mappings: {
                config: {
                    properties: {
                        buildNum: {
                            type: 'string',
                            index: 'not_analyzed'
                        },
                        domainName: {
                            type: 'string',
                            index: 'not_analyzed'
                        }
                    }
                }
            }
        }
    });
}

function createConfig(client, index, id, buildNum, domainName) {
    console.log(`Create config ${index}`);
    return client.create({
        index: index,
        type: "config",
        id: id,
        body: {
            "buildNum": buildNum,
            // "defaultIndex": "cdr-*",
            "domainName": domainName || null
        }
    });
}

function createIndexPattern(client, index) {
    console.log(`Create pattern ${index}`);
    createDefaultVisualizations(client, index);
    return client.create({
        id: `cdr-*`,
        index: index,
        type: 'index-pattern',
        body: {
            title: "cdr-*",
            timeFieldName: "variables.start_stamp",
            fields: FIELDS
        }
    });
}

function createDefaultVisualizations(client, index) {
    DEF_SEARCH.forEach( i => {
        client.create({
            id: i._id,
            index: index,
            type: 'search',
            body: i.body
        });
    });

    DEF_VIS.forEach( i => {
        client.create({
            id: i._id,
            index: index,
            type: 'visualization',
            body: i.body
        });
    });

    DEF_DASH.forEach( i => {
        client.create({
            id: i._id,
            index: index,
            type: 'dashboard',
            body: i.body
        });
    });
}

